To use JACS you create an Agent and then use it to create docoments that conform to the JACS Header format. First, create a json document that follows the schema for an agent, and use it in the library to start building other things. { "$schema": "https://hai.ai/schemas/agent/v1/agent-schema.json", "name": "Agent Smith", "agentType": "ai", "description": "An agent without keys, id or version", "favorite-snack": "mango"
} An id, version etc, will be created when you load the file from the command line jacs agent create ./examples/raw/mysecondagent.new.json --create-keys true Your agent will look something like this and you will have also created keys. The agent is self-signed and all the fields are hashed. There is also a public and private key created in the directory set with jacs_key_directory. DO NOT use the keys included in the repo. { "$schema": "https://hai.ai/schemas/agent/v1/agent-schema.json", "agentType": "ai", "description": "An agent without keys, id or version", "jacsId": "809750ec-215d-440f-9e03-f71114924a1d", "jacsOriginalDate": "2024-04-11T05:40:15.934777+00:00", "jacsOriginalVersion": "8675c919-cb3a-40c8-a716-7f8e04350651", "jacsSha256": "45c7af0a701a97907926910df7005a0a69e769380314b1daf15c7186d3c7263f", "jacsSignature": { "agentID": "809750ec-215d-440f-9e03-f71114924a1d", "agentVersion": "8675c919-cb3a-40c8-a716-7f8e04350651", "date": "2024-04-11T05:40:15.949350+00:00", "fields": [ "$schema", "agentType", "description", "jacsId", "jacsOriginalDate", "jacsOriginalVersion", "jacsVersion", "jacsVersionDate", "name" ], "publicKeyHash": "8878ef8b8eae9420475f692f75bce9b6a0512c4d91e4674ae21330394539c5e6", "signature": "", "signing_algorithm": "RSA-PSS" }, "jacsVersion": "8675c919-cb3a-40c8-a716-7f8e04350651", "jacsVersionDate": "2024-04-11T05:40:15.934777+00:00", "name": "Agent Smith"
} You can verify you are set up with this command: jacs agent verify -a ./examples/agent/fe00bb15-8c7f-43ac-9413-5a7bd5bb039d\:1f639f69-b3a7-45d5-b814-bc7b91fb3b97.json To make it easier to use, add jacs_agent_id_and_version to your config and you can just run jacs agent verify
